class Solution(object):
    def minimumBeautifulSubstrings(self, s):
        """
        :type s: str
        :rtype: int
        """
        def is_power_of_5(n):
            while n > 1:
                if n % 5 != 0:
                    return False
                n /= 5
            return n == 1

        def dfs(index):
            if index == len(s):
                return 0
            if s[index] == '0':
                return float('inf')
            min_count = float('inf')
            num = 0
            for i in range(index, len(s)):
                num = num * 2 + int(s[i])
                if is_power_of_5(num):
                    min_count = min(min_count, 1 + dfs(i + 1))
            return min_count

        result = dfs(0)
        return result if result != float('inf') else -1
